inputValue:.byte 6
#Output: .byte 0:65536

.text

# call to encoding
# set the values of the functions parameters in registers $ai
	jal setup 				#The setup function initialises all of the t registers.				
	jal encoding
	jal BitmapDisplay
	jal decoding
	jal BitmapDisplay2


# exit
	addi $v0,$zero,10
	syscall
setup:

	add $t0, $t0, $zero			# Clearing down the $t0 register. For later holding the location to point to in the array.
	add $t3, $t3, $zero			# Clearing down the $t3 register. For later holding the mask.
	add $t4, $t4, $zero			# Clearing down the $t4 register. For later holding "ronaldo".
	add $t5, $t5, $zero			# Clearing down the $t5 register. For later holding "tiger".
	add $t6, $t6, $zero			# Clearing down the $t6 register. For later holding the cover image added to the secret image.
	add $t7, $t7, $zero			# Clearing down the $t7 register. For later holding the address of the output array.
	add $t8, $t8, $zero
	add $t9, $t9, $zero
	

encoding:
#read the values of the function paramters from the $a registers
# instruction go here....

	la $t1, ronaldo
	la $a0, ronaldo
	la $t2, tiger

	add $a1, $a0, 0x10000			# Store the value for the end of the bitmap array.
	la $t7, Output				# Load the address of Output into $t7.
Stego:

	lbu $t0, 0($t2) 			# Loads the data in the address of $t2 into $t0
	lbu $t5, 0($t1)				# Loads the data in the address of $t1 into $t5
	
	#add $t3, $zero, 0xF0			# Put the binary value 11110000 into $t3, this is the mask.

	#VVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVVV#
	#MODIFYING THE MASK BASED ON USER INPUT#	
	add $t3, $zero, 0xFF 			#Set the mask to be 8 bits of 1's (1111 1111)
	lbu $t8, inputValue			#Load the value from the data segment into $t8 for later processing.
	sll $t9,$t8,2				#Multiply the contents in  $t8 by 4 and store it in $t9.
	sub $t9, $t9, 1				#Subtract 1 from $t9 contents.
	sub $t3, $t3, $t9			#Subtract the inputted value from the original mask to get the user defined mask
	#^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^#

	and $t3, $t3, $t0			# "Nobody cared who I was until I put on the mask..."  (Puts the mask on.) The mask makes all of the LSBs of the image be hidden by 0s.
	srl $t4, $t5, 4				# Shift the value in $t5 right by a user defined amount of bits, stored in $t4. This moves the secret images MSBs into it's LSBs and fills the MSBs with 0s.
	add $t6, $t4, $t3			# Add the cover image and secret image together. This produces the stegonography image, where one image is hidden within the other.

	sb $t6, 0($t7)				# Store the current pixel in the array.
	addi $t7, $t7, 1				# Increment the pointer in the output array by 1.
	addi $t1, $t1, 1				# Increment the pointer in the "ronaldo"array by 1.
	addi $t2, $t2, 1				# Increment the pointer in the "tiger" array by 1.
	addi $a0, $a0, 1
	
	blt $a0, $a1, Stego
		
	jr $ra  # every function ends with this instruction
	
BitmapDisplay:
	addi $t0, $zero, 16384 		# 128*128 = 16384
	la $a0, Output
	
	sll $t0, $t0, 2
	add $a1, $a0, $t0
	
	#lui $s7, 0x1004				# Send to the Heap.
	
BitmapLoop:
	lw  $t7, 0($a0)
	sw $t7, 0($a0)
	
	add $a0, $a0, 4
#addi $s7, $s7, 4
	
	blt $a0, $a1, BitmapLoop

	jr $ra  # every function ends with this instruction
	
	
	
decoding:
# instruction go here....
	
	la $a2, Output 				# Load the address of the output into $a2
	la $t1, Output
	la $t5, tiger
	la $t4, ronaldo
	
	addi $a3, $a0, 0x10000			#add the size of the array to the first pointer to find the end point of the output
	
Destego:
	addi $t3, $zero, 0xF0			# Recreates mask of 11110000
	
	and $t2, $t7, $t3			# Stores the four MSB of the output into a new variable as they are the cover image
	sb $t2, 0($t5) 				# $t5 will display the cover image(Tiger). The current bit is saved into this array.
	
	sll $t6, $t7, 4				# Shifts the four LSB to be in the MSB position. This is the secret image
	sb $t6, 0($t4)				# Stores the secret image into the $t4 array
	
	addi $t7, $t7, 1				# Increment the pointer in the output array by 1.
	addi $t6, $t6, 1				# Increment the pointer in the "ronaldo"array by 1.
	addi $t2, $t2, 1				# Increment the pointer in the "tiger" array by 1.
	addi $a2, $a2, 1				# add 1 to the array pointer as conversion is done byte by byte

	blt $a2, $a3, Destego

	jr $ra

# BITMAP DISPLAY AFTER DECODING

BitmapDisplay2:
	addi $t0, $zero, 65536		# 128*256 = 32768
	la $a2, Output
	
	sll $t0, $t0, 4
	add $a3, $a2, $t0

	
BitmapLoop2:
	lw  $t7, 0($a2)
	sw $t7, 0($a2)
	
	add $a2, $a2, 4
	
	blt $a2, $a3, BitmapLoop2

	jr $ra
